import React from 'react';

const Todo=(props)=>{
    return (
        <>
        <i class="fa fa-times"
            onClick={()=>{
                props.onSelect(props.id);
            }}
        />
    <li>{props.text}</li> <br/>
        </>
    )
};
export default Todo;
